document.addEventListener("DOMContentLoaded", () => {
  // Get all "navbar-burger" elements
  const $navbarBurgers = Array.prototype.slice.call(
    document.querySelectorAll(".navbar-burger"),
    0
  );

  // Add a click event on each of them
  $navbarBurgers.forEach((el) => {
    el.addEventListener("click", () => {
      // Get the target from the "data-target" attribute
      const target = el.dataset.target;
      const $target = document.getElementById(target);

      // Toggle the "is-active" class on both the "navbar-burger" and the "navbar-menu"
      el.classList.toggle("is-active");
      $target.classList.toggle("is-active");
    });
  });

  let link = document.createElement("link");
  link.rel = "import";
  link.href =
    "https://raw.githubusercontent.com/PAIR-code/facets/1.0.0/facets-dist/facets-jupyter.html";
  link.onload = function () {
    const dive = document.querySelector("#facets-visualization");
    dive.data = data;

    // presets don't work with atlasUrl
    // var presets = {
    //   "imageFieldName": "Country"
    // };

    // for (var key in presets) {
    //   if (presets.hasOwnProperty(key)) dive[key] = presets[key];
    // }

    function GenerateInfoTemplate(dataObject) {
      const dataList = document.createElement("dl");

      const id_dtElement = document.createElement("dt");
      id_dtElement.appendChild(document.createTextNode("ID"));
      dataList.appendChild(id_dtElement);

      const id_ddElement = document.createElement("dd");
      id_ddElement.appendChild(document.createTextNode(dataObject.ID));
      dataList.appendChild(id_ddElement);

      const country_dtElement = document.createElement("dt");
      country_dtElement.appendChild(document.createTextNode("Country"));
      dataList.appendChild(country_dtElement);

      const country_ddElement = document.createElement("dd");
      country_ddElement.appendChild(
        document.createTextNode(dataObject.Country)
      );
      dataList.appendChild(country_ddElement);

      const fitzpatrick_dtElement = document.createElement("dt");
      fitzpatrick_dtElement.appendChild(
        document.createTextNode("Fitzpatrick Skin Type")
      );
      dataList.appendChild(fitzpatrick_dtElement);

      const fitzpatrick_ddElement = document.createElement("dd");
      fitzpatrick_ddElement.appendChild(
        document.createTextNode(dataObject["Fitzpatrick Skin Type"])
      );
      dataList.appendChild(fitzpatrick_ddElement);

      const gender_dtElement = document.createElement("dt");
      gender_dtElement.appendChild(document.createTextNode("Gender"));
      dataList.appendChild(gender_dtElement);

      const gender_ddElement = document.createElement("dd");
      gender_ddElement.appendChild(document.createTextNode(dataObject.Gender));
      dataList.appendChild(gender_ddElement);

      const intersectional_dtElement = document.createElement("dt");
      intersectional_dtElement.appendChild(
        document.createTextNode("Intersectional Subgroup")
      );
      dataList.appendChild(intersectional_dtElement);

      const intersectional_ddElement = document.createElement("dd");
      intersectional_ddElement.appendChild(
        document.createTextNode(dataObject["Intersectional Subgroup"])
      );
      dataList.appendChild(intersectional_ddElement);

      const microsoft_predicted_dtElement = document.createElement("dt");
      microsoft_predicted_dtElement.appendChild(
        document.createTextNode("Microsoft API Predicted Gender")
      );
      dataList.appendChild(microsoft_predicted_dtElement);

      const microsoft_predicted_ddElement = document.createElement("dd");
      microsoft_predicted_ddElement.appendChild(
        document.createTextNode(dataObject["Microsoft API Predicted Gender"])
      );
      dataList.appendChild(microsoft_predicted_ddElement);

      const microsoft_match_dtElement = document.createElement("dt");
      microsoft_match_dtElement.appendChild(
        document.createTextNode("Microsoft API Gender Match")
      );
      dataList.appendChild(microsoft_match_dtElement);

      const microsoft_match_ddElement = document.createElement("dd");
      microsoft_match_ddElement.appendChild(
        document.createTextNode(dataObject["Microsoft API Gender Match"])
      );
      dataList.appendChild(microsoft_match_ddElement);

      const ibm_predicted_dtElement = document.createElement("dt");
      ibm_predicted_dtElement.appendChild(
        document.createTextNode("IBM API Predicted Gender")
      );
      dataList.appendChild(ibm_predicted_dtElement);

      const ibm_predicted_ddElement = document.createElement("dd");
      ibm_predicted_ddElement.appendChild(
        document.createTextNode(dataObject["IBM API Predicted Gender"])
      );
      dataList.appendChild(ibm_predicted_ddElement);

      const ibm_match_dtElement = document.createElement("dt");
      ibm_match_dtElement.appendChild(
        document.createTextNode("IBM API Gender Match")
      );
      dataList.appendChild(ibm_match_dtElement);

      const ibm_match_ddElement = document.createElement("dd");
      ibm_match_ddElement.appendChild(
        document.createTextNode(dataObject["IBM API Gender Match"])
      );
      dataList.appendChild(ibm_match_ddElement);

      const face_predicted_dtElement = document.createElement("dt");
      face_predicted_dtElement.appendChild(
        document.createTextNode("Face++ API Predicted Gender")
      );
      dataList.appendChild(face_predicted_dtElement);

      const face_predicted_ddElement = document.createElement("dd");
      face_predicted_ddElement.appendChild(
        document.createTextNode(dataObject["Face++ API Predicted Gender"])
      );
      dataList.appendChild(face_predicted_ddElement);

      const face_match_dtElement = document.createElement("dt");
      face_match_dtElement.appendChild(
        document.createTextNode("Face++ API Gender Match")
      );
      dataList.appendChild(face_match_dtElement);

      const face_match_ddElement = document.createElement("dd");
      face_match_ddElement.appendChild(
        document.createTextNode(dataObject["Face++ API Gender Match"])
      );
      dataList.appendChild(face_match_ddElement);

      return dataList;
    }

    let infoCard = dive.shadowRoot.querySelector("facets-dive-info-card");
    let diveControls = dive.shadowRoot.querySelector("facets-dive-controls");

    let backgroundCanvasParent =
      dive.shadowRoot.querySelector("facets-dive-vis");
    let backgroundCanvas = backgroundCanvasParent.shadowRoot
      .getElementById("holder")
      .querySelector("canvas");

    backgroundCanvas.style.backgroundColor = "#191919";

    var mq = window.matchMedia("(max-width: 375px)");
    function ResizeVisualization() {
      if (mq.matches) {
        infoCard.style.zoom = "25%";
      } else {
        infoCard.style.zoom = "100%";
      }
    }

    mq.addEventListener("change", ResizeVisualization);
    ResizeVisualization()
    

    dive.infoRenderer = function (dataObject, containerElem) {
      const info_template = GenerateInfoTemplate(dataObject);
      containerElem.appendChild(info_template);
    };

    dive.atlasUrl =
      "data:image/png;base64,";
  };

  document.head.appendChild(link);
});
